const require_utils = require('../../../common/utils.cjs');

//#region src/namespaces/blogchannel/generate/utils.ts
const generateFeed = (feed) => {
	if (!require_utils.isObject(feed)) return;
	return require_utils.trimObject({
		"blogChannel:blogRoll": require_utils.generateCdataString(feed.blogRoll),
		"blogChannel:blink": require_utils.generateCdataString(feed.blink),
		"blogChannel:mySubscriptions": require_utils.generateCdataString(feed.mySubscriptions)
	});
};

//#endregion
exports.generateFeed = generateFeed;